import React from 'react';
import '../../../node_modules/mdi-react/css/materialdesignicons.css';
import '../../../node_modules/mdi-react/css/materialdesignicons.min.css';
import AlertIcon from 'mdi-react/AlertIcon';
import AlertCircleIcon from 'mdi-react/AlertCircleIcon';

export default function Dashboard() {
  return(
      
   
    <div>
       <h2 style={{"text-align": "center"}}>Welcome Align</h2>
     
      <AlertIcon color="#fff" />
      
      <AlertCircleIcon className="some-class" size={16} />
     
      <AlertIcon size="1em" />
    </div>
      );
}
